package main

import (
	"context"
	"github.com/samego-ai/draw_roi/pb"
	"google.golang.org/grpc"
	"log"
)

const (
	ServerAddress = "127.0.0.1:1280"
	ImageBase64   = ""
)

func main() {
	conn, err := grpc.Dial(ServerAddress, grpc.WithInsecure())
	if err != nil {
		log.Fatal("can't connect "+ServerAddress, err)
	}
	defer conn.Close()
	client := pb.NewDrawClient(conn)

	request := &pb.MultiRectangleRequest{}
	request.Rectangle = append(request.Rectangle, &pb.MultiRectangleRequestRectangle{X: 30, Y: 30, W: 50, H: 30})
	request.Title = "github.com/samego-ai/draw_roi"
	request.Image = ImageBase64

	response, err := client.MultiRectangle(context.Background(), request)
	if err != nil {
		log.Fatal("request handler failure " + err.Error())
	}
	if response != nil {
		log.Println(response.Message)
	}
}
